import React from "react";

import Box from "@mui/material/Box";
import Breadcrumbs from "@mui/material/Breadcrumbs";
import Button from "@mui/material/Button";
import Link from "@mui/material/Link";
import Stack from "@mui/material/Stack";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell, { tableCellClasses } from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Typography from "@mui/material/Typography";
import { alpha, styled, useTheme } from "@mui/material/styles";
import Footer from "../Footer/Footer";
import { useNavigate } from "react-router-dom";

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  border: "none",
  fontSize: "1rem",
  textAlign: "center",

  [`&.${tableCellClasses.head}`]: {
    backgroundColor: theme.palette.primary.main,
    color: "white",
    fontWeight: "600",
  },

  [`&.${tableCellClasses.body}`]: {
    color: theme.palette.gray2.main,
    fontWeight: "500",
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  "&:nth-of-type(odd)": {
    backgroundColor: "white",
  },

  "&:nth-of-type(even)": {
    backgroundColor: alpha(theme.palette.primary.main, 0.2),
  },
}));

const createRowData = (id, date, totalCourse, totalPrice) => {
  return { id, date, totalCourse, totalPrice };
};

const rows = [
  createRowData("SOU00003", "12 July 2022", 1, "450.000"),
  createRowData("SOU00002", "05 Februari 2022", 2, "900.000"),
  createRowData("SOU00001", "30 August 2021", 1, "600.000"),
];

const InvoicePage = () => {
  const theme = useTheme();
  const primaryColor = theme.palette.primary.main;
  const gray2 = theme.palette.gray2.main;
  const gray3 = theme.palette.gray3.main;
  const navigate = useNavigate();

  return (
    <div>
      <Stack
        spacing={4}
        sx={{
          width: "1140px",
          margin: "0 auto",
          marginTop: "46px",
          marginBottom: "207px",
        }}
      >
        <Breadcrumbs separator=">" sx={{ color: gray3, fontWeight: "600" }}>
          <Link
            underline="hover"
            href="#"
            sx={{ color: gray3, fontWeight: "600" }}
          >
            Home
          </Link>
          <Typography
            paragraph={true}
            color="primary"
            sx={{ margin: "0", fontWeight: "600" }}
          >
            Invoice
          </Typography>
        </Breadcrumbs>

        <Stack spacing={3}>
          <Typography
            variant="h6"
            component="h1"
            sx={{ color: gray2, fontWeight: "600", textAlign: "left" }}
          >
            Menu Invoice
          </Typography>

          <TableContainer component={Box}>
            <Table sx={{ width: "1140px" }}>
              <TableHead>
                <TableRow>
                  <StyledTableCell>No</StyledTableCell>
                  <StyledTableCell>No. Invoice</StyledTableCell>
                  <StyledTableCell>Date</StyledTableCell>
                  <StyledTableCell>Total Course</StyledTableCell>
                  <StyledTableCell>Total Price</StyledTableCell>
                  <StyledTableCell>Action</StyledTableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {rows.map((row, index) => (
                  <StyledTableRow key={index}>
                    <StyledTableCell>{index + 1}</StyledTableCell>
                    <StyledTableCell>{row.id}</StyledTableCell>
                    <StyledTableCell>{row.date}</StyledTableCell>
                    <StyledTableCell>{row.totalCourse}</StyledTableCell>
                    <StyledTableCell>IDR {row.totalPrice}</StyledTableCell>
                    <StyledTableCell>
                      <Button
                        variant="contained"
                        color="secondary"
                        href="#"
                        onClick={()=> navigate('/detailinvoice')}
                        sx={{
                          color: primaryColor,
                          width: "180px",
                          borderRadius: "8px",
                          fontWeight: "700",
                          textTransform: "none",
                          boxShadow: "none",
                        }}
                      >
                        Details
                      </Button>
                    </StyledTableCell>
                  </StyledTableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </Stack>
      </Stack>

      {/* <Footer /> */}
    </div>
  );
};

export default InvoicePage;
export { StyledTableRow, StyledTableCell };
